INSERT INTO `craft_matrixcontent_blocks` (`id`, `elementId`, `locale`, `field_oneColumn_heading`, `field_oneColumn_body`, `field_oneColumn_backgroundColor`, `field_homeHero_heading`, `field_homeHero_body`, `field_homeHero_backgroundColor`, `field_twoColumns_heading`, `field_twoColumns_bodyLeft`, `field_twoColumns_bodyRight`, `field_twoColumns_columnsLeft`, `field_twoColumns_columnsRight`, `field_twoColumns_backgroundColor`, `field_homePrograms_heading`, `field_homePrograms_body`, `field_homePrograms_backgroundColor`, `field_homeHero_contactButton`, `field_secondaryHero_heading`, `field_secondaryHero_body`, `field_secondaryHero_contactButton`, `field_secondaryHero_backgroundColor`, `field_secondaryHero_mapAddress`, `field_secondaryHero_mapTitle`, `field_secondaryHero_flexibleArea`, `field_staff_staffName`, `field_staff_staffTitle`, `field_staff_body`, `field_secondaryHero_mapContent`, `field_homeLocations_heading`, `field_homeLocations_body`, `field_contact_heading`, `field_contact_body`, `field_contact_backgroundColor`, `field_events_heading`, `field_events_body`, `field_events_location`, `field_twoColumns_contactButton`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '15', 'en_us', NULL, NULL, NULL, 'Kick. Punch. Learn.', '<p>Freddie Poole’s Martial Arts® is a unique and modern training system that combines traditional values and principles with a modern system of combat, self-defense and fitness.&nbsp;</p>', '#000000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2016-03-16 02:47:49', '2016-04-21 04:23:27', 'f2d76f37-eb8f-4832-ad82-f0c1890bec23'),
 ('2', '18', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Approach', '<p>This unique approach creates a balanced and well-rounded martial artist. The key to our success is that each discipline is introduced in stages to the student, rather than front-loading a program. This methodical approach ensures students are learning and mastering techniques at the highest level, as opposed to just going through motions.&nbsp;</p>', '#000000', '0', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2016-03-16 04:17:39', '2016-04-21 04:23:27', 'c1857473-ee8a-4f42-888d-7ef19a36f487'),
 ('3', '21', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'Brazilian Jiu Jitsu', '<p>Brazilian Jiu-jitsu classes in Dallas (BJJ) is primarily a ground fighting art, a grappling style of Martial Arts that has roots and evolved from Japanese Judo and Classical jujutsu. Brazilian Jiu-jitsu specializes in ground techniques such as positional control and the use of leverage for reversals and submissions holds (joint lock and chokes) to overcome the size and strength of opponents. BJJ provides a clear path and strategy for victory in a self-defense scenario or competition. As a sport it is a safe and entertaining art that can be practiced for a lifetime of fitness and well-being.</p>', '1', '#000000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2016-03-24 02:37:17', '2016-03-24 03:49:46', '728f794f-be3e-4a00-8dba-a4629229b816'),
 ('4', '22', 'en_us', 'History', '<p>Most people involved in Martial Arts are familiar with the basic history of BJJ. How a Japanese Jiu-jitsu expert, Maeda, came to Brazil as part of a diplomatic mission to found and establish a Japanese colony. He befriended Gastao Gracie, a man of Scottish decent who had influence in local political circles.</p>\r\n\r\n<p>Maeda offered to teach Gracie’s sons Jiu-jitsu.<br>The Gracie boys became very proficient in jiu-jitsu. Being a large family they never lacked training partners and new ideas for practicing and training daily within the family and nephews the Machados. This went on for generations. Later opening their own schools and developing their own additions and modifications to the techniques they had being taught, as a test of their skill, the Gracies fought many matches against other styles with great success.</p>\r\n\r\n\r\n\r\n<p>In this manner they came to understand which techniques worked and which did not. They based their developing martial arts on their combat experiences over generations. With great success in MMA competitions, Brazilian jiu-jitsu has establish itself as an extremely effective martial arts and one of the most sought out.</p>', '#000000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2016-03-24 02:37:17', '2016-03-24 03:49:46', 'ab12eaea-f6f0-4a14-86c0-83ab94274993'),
 ('5', '23', 'en_us', 'The BJJ strategy and the Japanese legacy', '<p>eda taught the Gracie’s the art of “Randori” or live training (rolling) where safe but effective techniques can be applied with full resistance to opponents, as long as they agree to “tap-out” or submit (surrender) when a technique is successfully applied. This way, two opponents can face each other and fight close to full power which makes training much more realistic to a real fight, therefore more effective.</p>\r\n\r\n<p>The genius of the Gracie’s lay in the strategy they implemented to win fights, which can be seen in sport point systems, they implemented in competition. The Gracie’s realized that fighting a bigger stronger opponent and trading blows was not a good idea, so they developed a strategy where they would take a standing opponent or fighter out of their comfort zone (stand up skill) put them on the ground and expose them to their great ground skills, positional control, leverage and submissions.<br>The Gracie’s realized that certain positions were better to attack and defend so they strategized ways from any position on the ground to a position where they can reverse, control and submit their opponent.</p>', '#f5f5f5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2016-03-24 02:37:17', '2016-03-24 03:49:46', '3334a10f-a7cd-4c7f-b3e5-967b696d8b3f'),
