 ('2', 'field', '5', 'en_us', ' 000000 bjj bg 2x freddie poole s martial arts is a unique and modern training system that combines traditional values and principles with a modern system of combat self defense and fitness 1 kick punch learn 000000 approach bg 2x this unique approach creates a balanced and well rounded martial artist the key to our success is that each discipline is introduced in stages to the student rather than front loading a program this methodical approach ensures students are learning and mastering techniques at the highest level as opposed to just going through motions approach dragons juniors location bg 2x we currently have 2 locations to serve you locations 000000 bjj bg 2x you too can enjoy the benefits of martial arts classes in dallas come see for yourself why martial arts have been so popular for so many years our black belt instructors are here to help you achieve all your martial arts and fitness goals col 3 of 5 col 2 of 5 1 '),
